import React, { useState } from 'react';
import axios from 'axios';

function App() {
  // Login state
  const [loginForm, setLoginForm] = useState({ email: '', password: '' });
  const [token, setToken] = useState('');
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [loginMessage, setLoginMessage] = useState('');

  // Contact form state
  const [contactForm, setContactForm] = useState({ name: '', email: '' });
  const [contactMessage, setContactMessage] = useState('');

  // Handle login input
  const handleLoginChange = (e) => {
    setLoginForm({ ...loginForm, [e.target.name]: e.target.value });
  };

  // Handle contact form input
  const handleContactChange = (e) => {
    setContactForm({ ...contactForm, [e.target.name]: e.target.value });
  };

  // Submit login
  const handleLoginSubmit = async (e) => {
    e.preventDefault();
    setLoginMessage('');

    try {
      const response = await axios.get('http://localhost:8000/api/login', {
        email: loginForm.email,
        password: loginForm.password,
      });

      setToken(response.data.access_token);
      setIsAuthenticated(true);
      setLoginMessage('Login successful!');
    } catch (err) {
      console.error('Login error:', err);
      setLoginMessage(
        err.response?.data?.message || 'Login failed. Check credentials.'
      );
    }
  };

  // Submit contact form
  const handleContactSubmit = async (e) => {
    e.preventDefault();
    setContactMessage('');

    try {
      const response = await axios.post(
        'http://localhost:8000/api/contacts',
        contactForm,
        {
          headers: {
            Authorization: `Bearer ${token}`,
            'Content-Type': 'application/json',
            Accept: 'application/json',
          },
        }
      );

      setContactMessage(response.data.message || 'Contact saved!');
      setContactForm({ name: '', email: '' });
    } catch (err) {
      console.error('Contact form error:', err);

      if (err.response?.data?.errors) {
        setContactMessage(
          Object.values(err.response.data.errors).flat().join(' ')
        );
      } else {
        setContactMessage(err.response?.data?.message || 'Error submitting form.');
      }
    }
  };

  return (
    <div style={{ padding: '2rem' }}>
      {!isAuthenticated ? (
        <>
          <h2>Login</h2>
          <form onSubmit={handleLoginSubmit}>
            <div>
              <label>Email:</label><br />
              <input
                type="email"
                name="email"
                value={loginForm.email}
                onChange={handleLoginChange}
                required
              />
            </div>
            <div>
              <label>Password:</label><br />
              <input
                type="password"
                name="password"
                value={loginForm.password}
                onChange={handleLoginChange}
                required
              />
            </div>
            <button type="submit" style={{ marginTop: '1rem' }}>Login</button>
          </form>
          {loginMessage && <p>{loginMessage}</p>}
        </>
      ) : (
        <>
          <h2>Contact Form</h2>
          <form onSubmit={handleContactSubmit}>
            <div>
              <label>Name:</label><br />
              <input
                type="text"
                name="name"
                value={contactForm.name}
                onChange={handleContactChange}
                required
              />
            </div>
            <div>
              <label>Email:</label><br />
              <input
                type="email"
                name="email"
                value={contactForm.email}
                onChange={handleContactChange}
                required
              />
            </div>
            <button type="submit" style={{ marginTop: '1rem' }}>Submit</button>
          </form>
          {contactMessage && <p>{contactMessage}</p>}
        </>
      )}
    </div>
  );
}

export default App;
